def GCSkew(text): 
    """Inputs DNA as a text string.  Scores each G base +1 and each C as -1. 
    Outputs score at each base as a list of integers.
    """
    skew = []
    skew_calc = 0
    skew.append(skew_calc) 
    text = text.upper()
    for base in text:
        if base == 'C':
            skew_calc -= 1
        elif base == 'G':
            skew_calc += 1
        skew.append(skew_calc)
    return skew
    

def MinSkewPos(text):
    """Inputs a DNA text string.  Outputs the index of the 
    minimum G-C skew in the DNA string in order to find the ORI.
    G-C skew turns from decreasing to increasing at the ORI
    the position outputs the position starting at 1 not std python 
    zero indexing.
    """
    skew = GCSkew(text)
    min_skew = min(skew)
    position = []
    for i in range(len(skew)):
        if skew[i] == min_skew:
            position.append(str(i))#remove str call if output should be numeric
    return " ".join(position)

def MaxSkewPos(text):
    """Inputs a DNA text string.  Outputs the index of the 
    maximum G-C skew in the DNA string in order to find the ORI.
    G-C skew turns from decreasing to increasing at the ORI
    the position outputs the position starting at 1 not std python 
    zero indexing.
    """
    skew = GCSkew(text)
    max_skew = max(skew)
    position = []
    for i in range(len(skew)):
        if skew[i] == max_skew:
            position.append(str(i))#remove str call if output should be numeric
    return " ".join(position)

